"use strict";var panel={init:function(){this.labelPagIng()},labelPagIng:function(a){$.ajax({type:"POST",url:urlScope+"/Label/findAll",dataType:"json",data:{page:a||1,rows:10},success:function(c){var b=panel.packQueryData(c)},error:function(b){layer.msg("网络错误",{icon:1,time:1000})}})},packQueryData:function(c){if(c.result!="1"){layer.msg("获取数据失败",{icon:1,time:1000});return}var c=c.object;var a="";for(var b=0;b<c.length;b++){a+='<tr class="text-c"><td>'+(b+1)+"</td><td>"+c[b].labelName+'</td><td class="td-manage"><a title="删除" href="javascript:;" onclick=panel.label_del(this,'+c[b].id+') class="ml-5" style="text-decoration:none"><i class="Hui-iconfont">&#xe6e2;</i></a></td></tr>'}$("tbody").html(a)},label_del:function(a,b){layer.confirm("确认要删除吗？",function(c){$.ajax({type:"POST",url:urlScope+"/Label/deleteLabel",data:{id:b},dataType:"json",success:function(d){if(d.result!="1"){layer.msg("删除数据失败",{icon:1,time:1000});return}layer.msg("已删除!",{icon:1,time:1000});location.replace(location.href)},error:function(d){layer.msg("网络错误!",{icon:1,time:1000})}})})},label_add:function(d,b,a,c){layer_show(d,b,a,c)}};$(function(){panel.init()});